function sliderLoadHighlights(){$(".sky-main__highlights.owl-carousel").owlCarousel({center:!0,items:3,loop:!0,margin:15,nav:!0}),$(".sky-main__highlights.owl-carousel .owl-prev").html("<i class='fa fa-arrow-left' aria-hidden='true'></i>"),$(".sky-main__highlights.owl-carousel .owl-next").html("<i class='fa fa-arrow-right' aria-hidden='true'></i>")}window.onload=function(){fetch("https://sky-frontend.herokuapp.com/movies").then(i=>i.json()).then(i=>function(i){let e=i.filter(i=>"highlights"===i.type.trim().toLowerCase())[0].items,s=document.getElementById("highlights-movies");console.log(e),s.innerHTML=` \n      ${e.map(i=>`<img src='${i.images[0].url.replace("/1920x1080/","/669x391/")}' class='swiper-slide sky-main__highlights-wrapper-image'/>`).join("")}\n    `,sliderLoadHighlights()}(i))};